import React from 'react';

const Contact = () => {
    return (
        <>
        <div className="my-5">
            <h1 className="text-center">Contact Me</h1>
        </div>
        <div className="container contact_div">
            <div className="row"></div>
             <div className="col"></div>
        </div>
        </>
    )
}
export default Contact;
